INSERT INTO contacts (id, first_name, last_name, email_primary, email_secondary, company, website, company_linkedin, imdb, facebook, instagram, linkedin, wikipedia, biography, priority, seen_film, doc_branch_member, location_country, location_state, location_city, location_state_text, location_city_text, is_active, inactive_reason, inactive_reason_user_id, inactive_at, created_by_user_id, created_at, company_id) VALUES ('46', 'Aaron', 'Wickenden', 'null', 'null', 'null', 'null', 'null', 'https://pro.imdb.com/name/nm1704972/', 'null', 'https://www.instagram.com/aaron.wickenden/', 'https://www.linkedin.com/in/aaron-wickenden-150273/', 'null', 'I believe as Roger Ebert did that ...movies are like machines that generate empathy. For me, that transformative process happens most dynamically with documentaries. Ive devoted myself for nearly two decades across more than 20 feature films, primarily as editor, to an artistic storytelling discipline that aims for inventive storytelling, emotional resonance, social impact and mass communication. Over my career Ive been entrusted with the responsibility and honor of crafting: raw footage by Orson Welles, personal family footage from the Obama family, and unseen footage from across Anthony Bourdains entire career. \n \n\n The hallmarks of my aesthetics are playfulness and an aspiration for deep emotional communication, but in every film I start by responding to the strengths of the raw material and tracking my personal reaction to it. With each project I ask myself To what end is this story most useful for others? and that inquiry helps guide my artistic approach. The apotheosis of this method was the 2018 film Wont You Be My Neighbor?. The film connected deeply with audiences and is ranked the top documentary of all time by Rotten Tomatoes. When interviewed about our collaboration, Director Morgan Neville said Docs, in general, are made in the edit bay, archival docs even more so... we brought in Wickenden and hes amazing."\n \n\n As an editor, my most fundamental goal is to leverage my artistic craft, compassion and privilege to support others in conveying their stories. The results have been pretty good so far. By the numbers:\n \n\n 6 films have premiered at Sundance. 5 of these were with different directors and most recently Feels Good Man was awarded a Sundance Jury Prize in 2020.\n \n\n 5 have been Shortlisted (the final list of 15) for the Documentary Feature Academy Award and one film, Finding Vivian Maier was nominated in 2015.\n \n\n  4 films were collectively nominated for 10 Emmy Awards and 3 of those resulted in wins for Best Documentary.\n \n\n 3 have been nominated Best Documentary Feature at the Independent Spirit Awards and 2 have won this very prestigious honor. Thrice I have been nominated for an EMMY for Outstanding Editing (The Interrupters, Trials of Muhammad Ali, Roadrunner) \n \n\n 2 times I have been personally nominated for the ACE EDDIE for Best Documentary (Finding Vivian Maier, Wont You Be My Neighbor?).\n \n\n 1 time I got to hug Rashida Jones after she presented Jeff Malmberg and I the Critics Choice Award for Best Editing for Wont You Be My Neighbor?\n \n\n As a member of the Documentary Branch of AMPAS and ACE, I am also committed to supporting the documentary editing community through mentorships, masterclasses, and participating on juries. Recent highlights include:\n \n\n Cork International Film Festival - Doc Day: A Case Study in Editing Feature Documentary | Roadrunner, 2021\n \n\n Huntington University (Indiana) - Masterclass, 2020\n \n\n Karen Schmeer Film Editing Fellowship - Diversity in the Edit Room: Jury member, 2020\n \n\n Power of Storytelling Conference (Bucharest, Romania) - Featured Speaker, 2019\n \n\n Sundance Institute - New Frontier Storytelling Lab: Mentor, 2019\n \n\n LEF Foundation - LEF Moving Image Fund: Jury member, 2019\n \n\n True/False + Catapult Rough Cut Retreat: Mentor, 2018\n \n\n IDA - Getting Real Conference: Editing Panel, 2018\n \n\n BIG SKY Film Festival: Editing Masterclass, 2015\n \n\n Bertha Doc House (London): Editing Masterclass, 2015\n \n\n In my spare time, I can usually be found goofing off with my much better half, Jennifer Brandel, at one of Chicago''s dog beaches or promoting my own award winning film Almost There - which is available for rent on iTunes, Amazon Prime, Hulu, and Vimeo. I am always on lookout for new projects and also open to consultations and educational opportunities when time permits. Please don''t hesitate to be in touch via the contact page. Pro-tip: if you watch Almost There before reaching out you might get prioritized attention.', 'NONE', '0', '0', 'null', 'null', 'null', 'null', 'null', '1', 'null', 'null', 'null', 'null', '1761607382000', 'null');
