INSERT INTO contacts (id, first_name, last_name, email_primary, email_secondary, company, website, company_linkedin, imdb, facebook, instagram, linkedin, wikipedia, biography, priority, seen_film, doc_branch_member, location_country, location_state, location_city, location_state_text, location_city_text, is_active, inactive_reason, inactive_reason_user_id, inactive_at, created_by_user_id, created_at, company_id) VALUES ('81', 'Alison', 'Chernick', 'null', 'null', 'Voyeur Films', 'null', 'null', 'https://pro.imdb.com/name/nm1212650/', 'https://www.facebook.com/alison.chernick.3/', 'null', 'https://www.linkedin.com/in/alison-chernick-3979406/', 'null', 'Alison Chernick is a Grammy-nominated New York-based writer/director and filmmaker.\n \n\n She has directed numerous critically acclaimed short and feature-length documentaries on art stars, including The Jeff Koons Show, Matthew Barney No Restraint, Diagram of an Artist: Roy Lichtenstein, Martin Margiela: The Artist Is Absent, and Jackson Pollock: Blue Poles. Her films have been shown in theaters and museums around the world including the Guggenheim(s), the Smithsonian, San Francisco MOMA, and the Walker Art Center. \n \n\n Chernicks feature documentary on violinist Itzhak Perlman was nominated for a Grammy for Best Music Film. After premiering as the opening night of the Hamptons International Film Festival, Itzhak was broadcast on PBS American Masters, screened theatrically worldwide and streams on Amazon.\n \n\n Alison began her career in TV at VH1, MTV, the History Channel, National Geographic, Sundance Channel and Showtime. She is the recipient of a National Endowment for the Humanities Award, a New York Women in Film and Television Award and has received grants from the Loreen Arbus Foundation and Woman of Her Word. She was invited to judge the 2018 National Endowment for The Humanities. Her work continues to focus on art, music, fashion, gastronomy, science and healthcare. \n \n\n Chernick has global representation for commercials with RSA Films (Ridley Scott Associates).', 'NONE', '0', '1', 'null', 'null', 'null', 'null', 'null', '1', 'null', 'null', 'null', 'null', '1761607382000', '52');
